use joins;
CREATE TABLE IF NOT EXISTS `tn_2021_elections_results` (
    `State_Name` VARCHAR(10) CHARACTER SET utf8,
    `Assembly_No` INT,
    `Constituency_No` INT,
    `Year` INT,
    `month` INT,
    `DelimID` INT,
    `Poll_No` INT,
    `Position` INT,
    `Candidate` VARCHAR(44) CHARACTER SET utf8,
    `Sex` VARCHAR(1) CHARACTER SET utf8,
    `Party` VARCHAR(54) CHARACTER SET utf8,
    `Votes` INT,
    `Age` INT,
    `Candidate_Type` INT,
    `Valid_Votes` INT,
    `Electors` INT,
    `Constituency_Name` VARCHAR(23) CHARACTER SET utf8,
    `Constituency_Type` VARCHAR(3) CHARACTER SET utf8,
    `District_Name` VARCHAR(15) CHARACTER SET utf8,
    `Sub_Region` VARCHAR(19) CHARACTER SET utf8,
    `N_Cand` INT,
    `Turnout_Percentage` NUMERIC(4, 2),
    `Vote_Share_Percentage` NUMERIC(4, 2),
    `Deposit_Lost` VARCHAR(3) CHARACTER SET utf8,
    `Margin` INT,
    `Margin_Percentage` NUMERIC(4, 2),
    `ENOP` NUMERIC(3, 2),
    `pid` VARCHAR(10) CHARACTER SET utf8,
    `Party_Type_TCPD` INT,
    `Party_ID` INT,
    `last_poll` VARCHAR(4) CHARACTER SET utf8,
    `Contested` INT,
    `Last_Party` VARCHAR(10) CHARACTER SET utf8,
    `Last_Party_ID` INT,
    `Last_Constituency_Name` VARCHAR(22) CHARACTER SET utf8,
    `Same_Constituency` VARCHAR(5) CHARACTER SET utf8,
    `Same_Party` VARCHAR(5) CHARACTER SET utf8,
    `No_Terms` INT,
    `Turncoat` VARCHAR(5) CHARACTER SET utf8,
    `Incumbent` VARCHAR(5) CHARACTER SET utf8,
    `Recontest` VARCHAR(5) CHARACTER SET utf8,
    `MyNeta_education` VARCHAR(21) CHARACTER SET utf8,
    `TCPD_Prof_Main` VARCHAR(34) CHARACTER SET utf8,
    `TCPD_Prof_Main_Desc` VARCHAR(68) CHARACTER SET utf8,
    `TCPD_Prof_Second` VARCHAR(34) CHARACTER SET utf8,
    `TCPD_Prof_Second_Desc` VARCHAR(29) CHARACTER SET utf8,
    `Election_Type` VARCHAR(28) CHARACTER SET utf8
);


select * from tn_2021_elections_results;
select position ,candidate ,party ,sex ,age from tn_2021_elections_results where party='DMK' order by candidate asc;